        padding: "10px",


	},

	box: {
        marginBottom: "20px",
        background: "white",
        width: "250px",
        height: "750px",
        marginLeft: "auto",
        marginRight: "auto",
        textAlign: "center",
        borderRadius: 15,
        verticalAlign: "center",
        padding: "10px",
        color: "black",

	}
}));
// <div className={classes.wrapper} >
function BoardComponent() {
    const classes = useStyles();
    return (
        <div className={classes.wrapper}>
        <div className={classes.box.header}>Task Tracker</div>
		<div className={classes.box.content1}>To Do</div>
        <div className={classes.box.content2}>In Progress</div>
        <div className={classes.box.content3}>In Review</div>
        <div className={classes.box.content4}>Done</div>

	</div>
    )
}

export default BoardComponent
